import React from 'react';
import { NavDropdown } from 'react-bootstrap';
export class MyDropdown extends React.Component {

    constructor(props) {
      super(props);

      this.toggle = this.toggle.bind(this);
      this.onMouseEnter = this.onMouseEnter.bind(this);
      this.onMouseLeave = this.onMouseLeave.bind(this);
      this.state = {
        dropdownOpen: false
      };
    }

    toggle() {
      this.setState(prevState => ({
        dropdownOpen: !prevState.dropdownOpen
      }));
    }

    onMouseEnter() {
      this.setState({dropdownOpen: true});
    }

    onMouseLeave() {
      this.setState({dropdownOpen: false});
    }

    render() {
      return (
        <NavDropdown
        title="Sleep Test"
        id="basic-nav-dropdown"
        components={{ DropdownIndicator:() => null }}
        onMouseOver={this.onMouseEnter}
        onMouseLeave={this.onMouseLeave}
        // expanded={this.state.dropdownOpen}
        // toggle={this.toggle}
        >
        <NavDropdown.Item href="#action/3.1">Sleep score</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Sleep form</NavDropdown.Item>
      </NavDropdown>
      );
    }
  }
